
def find_period_lengths(s):
    n = len(s)
    periods = []

    # Iterate through all possible prefix lengths
    for i in range(1, n+1):
        # Check if the string can be generated by repeating the prefix
        if n % i == 0 and s[:i] * (n // i) == s:
            periods.append(i)
    
    return periods


# Test the function
s = input().strip()
periods = find_period_lengths(s)
print(*periods)
